import React from 'react';
import jsPDF from 'jspdf';
import 'jspdf-autotable';

const StudentTable = ({ students, loading }) => {
  // Ensure students is always an array
  const safeStudents = Array.isArray(students) ? students : [];

  // Debugging info
  console.log('StudentTable received:', safeStudents.length, 'students');
  if (safeStudents.length > 0) {
    console.log('First student example:', safeStudents[0]);
    // Öğrenci verilerinin yapısını incelemek için daha detaylı debug
    Object.keys(safeStudents[0]).forEach(key => {
      console.log(`Field: ${key}, Value:`, safeStudents[0][key]);
    });
  }

  const exportToPDF = () => {
    const doc = new jsPDF();
    doc.text('Öğrenci Listesi', 14, 10);

    const tableColumn = ['Ad Soyad', 'Öğrenci No', 'Bölüm', 'Fakülte', 'GPA', 'ECTS'];
    const tableRows = safeStudents.map((student) => [
      `${student.firstName || ''} ${student.lastName || ''}`,
      student.studentNumber || '',
      student.department?.name || '',
      student.faculty?.name || '',
      student.gpa || '',
      student.totalECTS || '',
    ]);

    doc.autoTable({
      head: [tableColumn],
      body: tableRows,
      startY: 20,
      theme: 'grid',
      headStyles: { fillColor: [155, 27, 27] },
    });

    doc.save('ogrenci-listesi.pdf');
  };

  const handleEditStudent = (studentId) => {
    console.log('Editing student:', studentId);
    // Burada öğrenciyi düzenleme sayfasına yönlendirme yapılabilir
    // window.location.href = `/edit-student/${studentId}`;
  };

  const handleDeleteStudent = (studentId) => {
    console.log('Deleting student:', studentId);
    if (window.confirm('Bu öğrenciyi silmek istediğinizden emin misiniz?')) {
      // Burada öğrenciyi silme API çağrısı yapılabilir
      console.log('Öğrenci silme onaylandı:', studentId);
    }
  };

  if (loading) {
    return <div>Öğrenciler yükleniyor...</div>;
  }

  if (!safeStudents.length) {
    return <div>Öğrenci bulunamadı. Lütfen API bağlantısını kontrol edin veya sistem yöneticisiyle iletişime geçin.</div>;
  }

  return (
    <div>
      {/* Export Button */}
      <div style={{ display: 'flex', justifyContent: 'flex-end', marginBottom: '1rem' }}>
        <button 
          onClick={exportToPDF} 
          style={exportBtnStyle}
          disabled={loading || !safeStudents.length}
        >
          PDF'e Aktar
        </button>
      </div>

      {/* Student Table */}
      <div style={{ overflowX: 'auto' }}>
        <table style={tableStyle}>
          <thead>
            <tr>
              <th style={thStyle}>Ad Soyad</th>
              <th style={thStyle}>Öğrenci No</th>
              <th style={thStyle}>Email</th>
              <th style={thStyle}>Bölüm</th>
              <th style={thStyle}>Fakülte</th>
              <th style={thStyle}>GPA</th>
              <th style={thStyle}>ECTS</th>
              <th style={thStyle}>İşlemler</th>
            </tr>
          </thead>
          <tbody>
            {safeStudents.map((student, i) => (
              <tr key={student.id || i}>
                <td style={tdStyle}>{`${student.firstName || ''} ${student.lastName || ''}`}</td>
                <td style={tdStyle}>{student.studentNumber || ''}</td>
                <td style={tdStyle}>{student.email || ''}</td>
                <td style={tdStyle}>{student.department?.name || ''}</td>
                <td style={tdStyle}>{student.faculty?.name || ''}</td>
                <td style={tdStyle}>{student.gpa || ''}</td>
                <td style={tdStyle}>{student.totalECTS || ''}</td>
                <td style={tdStyle}>
                  <div style={actionButtonsContainer}>
                    <button 
                      style={editButtonStyle} 
                      onClick={() => handleEditStudent(student.id)}
                      title="Öğrenciyi Düzenle"
                    >
                      Düzenle
                    </button>
                    <button 
                      style={deleteButtonStyle} 
                      onClick={() => handleDeleteStudent(student.id)}
                      title="Öğrenciyi Sil"
                    >
                      Sil
                    </button>
                  </div>
                </td>
              </tr>
            ))}
          </tbody>
        </table>
      </div>
    </div>
  );
};

// Table Styles
const tableStyle = {
  width: '100%',
  borderCollapse: 'collapse',
  marginTop: '2rem',
  fontFamily: 'Arial, sans-serif',
};

const thStyle = {
  backgroundColor: '#9B1B1B',
  color: 'white',
  fontWeight: 'bold',
  padding: '12px',
  border: '1px solid black',
  textAlign: 'left',
};

const tdStyle = {
  backgroundColor: '#e0e0e0',
  padding: '12px',
  border: '1px solid black',
  textAlign: 'left',
};

const exportBtnStyle = {
  width: '200px',
  height: '50px',
  padding: '10px 16px',
  backgroundColor: '#7b1fa2',
  color: 'white',
  border: 'none',
  borderRadius: '6px',
  fontWeight: 'bold',
  cursor: 'pointer',
};

const actionButtonsContainer = {
  display: 'flex',
  gap: '10px',
  justifyContent: 'center',
};

const editButtonStyle = {
  padding: '8px 16px',
  backgroundColor: '#7b1fa2',
  color: 'white',
  border: 'none',
  borderRadius: '4px',
  cursor: 'pointer',
  fontWeight: 'bold',
  minWidth: '80px',
};

const deleteButtonStyle = {
  padding: '8px 16px',
  backgroundColor: '#9C27B0',
  color: 'white',
  border: 'none',
  borderRadius: '4px',
  cursor: 'pointer',
  fontWeight: 'bold',
  minWidth: '80px',
};

export default StudentTable;
